import React from 'react';
import resumeimage from "../../assets/resumeimage.png";
import resume from "../../assets/resume.pdf";
import iconDownload from "../../assets/iconDownload.svg";

function Resume() {

    return(
        <div class="container">
            <div class="row p-3">
                <div class="col-lg-2 mx-auto">
                    <a href={resume} class="mx-auto" download='resume-Justin-Hanson'><img src={iconDownload} class="img-download" /></a> 
                </div>
                <div class="col-lg-10">
                    <p>
                        Please click the icon to download a pdf copy of my resume.  Thank you for visiting my site.
                    </p>
                </div>
            </div>
            <div class="row">
                <div class="col-lg-6">
                    <div class="mx-auto"><img src={resumeimage} class="mx-auto img-resume"/></div>

                </div>
                <div class="col-lg-6 mx-auto">
                    <img src={resumeimage} class="rounded float-start img-resume"/>
                </div>
            </div>
        </div>
    )
}

export default Resume;
